		public static void PopulateISSCmdletConfigurationEntries()
		{
			InitialSessionStateBuilder.AddCmdletConfigurationEntries(CmdletConfigurationEntries.ExchangeCmdletConfigurationEntries);
			InitialSessionStateBuilder.AddCmdletConfigurationEntries(CmdletConfigurationEntries.ExchangeNonEdgeCmdletConfigurationEntries);
			if (DatacenterRegistry.IsForefrontForOffice())
			{
				InitialSessionStateBuilder.AddCmdletConfigurationEntries(CmdletConfigurationEntries.eopRecipientCmdletConfigurationEntries);
			}
			if (!Datacenter.IsGallatinDatacenter() && !DatacenterRegistry.IsFFOGallatinDatacenter())
			{
				InitialSessionStateBuilder.AddCmdletConfigurationEntries(CmdletConfigurationEntries.ExchangeNonGallatinCmdletConfigurationEntries);
			}
			for (int i = 0; i < CmdletDynamicParameterTypes.CmdletTypeNames.Length; i++)
			{
				InitialSessionStateBuilder.AddDynamicParameter(CmdletDynamicParameterTypes.CmdletTypeNames[i], CmdletDynamicParameterTypes.DynamicParameterTypes[i]);
			}
		}

